import everest from "./img/everest.png";
import normandy from "./img/normandy.png";
export default [
  {
    title: "Mount Everest",
    location: "Nepal",
    startDate: "12 Jan, 2023",
    endDate: "24 Jan, 2023",
    description:
      "Mount Everest is Earth's highest mountain above sea level, located in the Mahalangur Himal sub-range of the Himalayas",
    img: everest,
  },

  {
    title: "Normandy",
    location: "France",
    startDate: "17 June, 2024",
    endDate: "23 June, 2024",
    description:
      "Normandy is a geogrpahical and cultural region in Norwestern Europe, roughly coextensive with the historical Duchy of Normandy",
    img: normandy,
  },
];
